import classes from "./Categories.module.css";

function Categories() {
  return (
    <>
      <div className={`container  ${classes.categories}`}>
        <div className="row justify-content-between">
          <div className="col-md-2">Smartphones</div>
          <div className="col-md-2">TV</div>
          <div className="col-md-2">Fridge</div>
          <div className="col-md-2">Watches</div>
          <div className="col-md-2">Headphones</div>
          <div className="col-md-2">Laptops</div>
        </div>
      </div>
    </>
  );
}

export default Categories;
